    status: u8, // 0 = idle, 1-15 = continuing action => 4 bit
    health: u8,
    has_been_seen: u1,
    target_x: u8,
    target_y: u8,
    damage: u8,
}

impl Character {
    pub fn get_id(self) -> u8 {
        self.id
    }

